                    "Documento Juntado",
                    "Expedição de documento",
                    "Protocolo Juntado",
                    "Remetido ao DJE Relação: 0343/2017 Teor do ato: Vistos. Trata-se de pedido de liberdade provisória formulado pelo acusado Gabriel, sustentando não ter praticado o delito de tráfico. Observo que a prova documental que era aguardada, após o término da audiência, veio aos autos, não havendo outras a produzir. Embora não se possa, nesse momento, valorar o mérito, - porquanto somente na sentença todas as questões poderão ser analisadas -, possível é reapreciar a questão da prisão cautelar, posto que ela independe do julgamento da causa e baseia-se na necessidade da custódia. Em relação a Gabriel, considerando o relato de Ana Carolina, em juízo (fls.620), negando receber droga dele, bem como o depoimento do policial civil Osmar (fls.618), que somente tinha denúncia de tráfico em relação um dos réus (Tiago), - o que, ao menos em tese, coloca Gabriel numa situação diferente de Tiago, à luz do que era sabido pela delegacia de entorpecentes -, contradizendo outros relatos no sentido de que ele (Gabriel) seria também traficante de maior porte (segundo o policial militar Carlos de Campos, fls.613, a droga achada com Gabriel era pequena, mais própria de usuário), considero ausente, nessa fase, os requisitos da prisão cautelar, pois o dano maior ao bem jurídico protegido, decorrente do tráfico, se ocorrido, não seria o causado por esse réu, razão pela qual concedo ao denunciado Gabriel liberdade provisória mediante termo de comparecimento a todos os atos do processo, sob pena de revogação, devendo ser expedido, em favor dele, alvará de soltura clausulado. Aguarde-se a vinda das alegações finais do réu Tiago e conclusos para sentença. Intimem-se. Advogados(s): Eugenio Carlo Balliano Malavasi (OAB 127964/SP), Eduardo Arantes Burihan (OAB 160969/SP), Armando Bertini Junior (OAB 87567/SP), Eurico Fernando Braz (OAB 275252/SP), Ademir Santos Rosa (OAB 312931/SP), Beatriz Bento Viana (OAB 313032/SP)",
